import React from "react";
import "../style/footer.css"


const Footer = ({ nombre }) => {
  return (
    <footer>
      <p>Realizado por: <a href="" target="_blank">ING (c) Santiago Jaramillo Duque</a> - <a>ING (c)Santiago Mejia Ocampo</a> - <a>ING (c) Rafael Urrea Gaviria</a></p>
    </footer>
  );
};

export default Footer;
